import React, { Component } from 'react';
import {Navbar,NavDropdown,Form,Button,FormControl,Nav} from 'react-bootstrap'
import logo from './logo.jpg'

export default class NavBar extends Component {
    constructor(props) {
      super(props);
    }
    render() {
      return (
        <div className="border-nav">
            <Navbar bg="light" expand="lg">
                <Navbar.Brand href="#home">
                    <img style={{width:"100px"}} src={logo}></img>
                </Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav" pullRight>
                    <Nav className="mr-auto">
                    <Nav.Link href="/timeslot">Home</Nav.Link>
                    <Nav.Link className="hidem" href="/">Login</Nav.Link>
                    <Nav.Link className="hidem" href="/signup">Sign Up</Nav.Link>
                    </Nav>
                </Navbar.Collapse>

                <Navbar.Collapse className="justify-content-end">
                  <Navbar.Text className={this.props.shouldHide ? 'hidden' : ''}>
                    Signed in as: <a href="#login">Abhass Gupta</a>
                  </Navbar.Text>
                </Navbar.Collapse>
            </Navbar>
        </div>
      );
    }
  }
